
import collections
class Solution(object):
    def highestPeak(self, isWater):
        waitlist=collections.deque()
        move = [[0,1],[1,0],[-1,0],[0,-1]]
        b =[[0 for j in range(len(isWater[0]))]for i in range(len(isWater))]
        map1 = [[0 for j in range(len(isWater[0]))]for i in range(len(isWater))]
        for i in range(len(isWater)):
            for j in range(len(isWater[0])):
                if isWater[i][j]==1:
                    b[i][j]=1
                    waitlist.append((i,j))
        while waitlist:
            x,y =waitlist.popleft()
            for i in range(4):
                if x+move[i][0] in range(len(isWater)) and y+move[i][1] in range(len(isWater[0])) and b[x+move[i][0]][y+move[i][1]]==0:
                    waitlist.append((x+move[i][0],y+move[i][1]))
                    b[x+move[i][0]][y+move[i][1]]=1
                    map1[x+move[i][0]][y+move[i][1]] = map1[x][y]+1
        return map1
